import './App.css';
import Home from './components/Home/Home.js';
import {MemoryRouter} from 'react-router-dom';
import RouteBlock from "./components/RouteBlock/RouteBlock";

function App() {
  return (
    <>
      <MemoryRouter>
        <Home />
        <RouteBlock />
      </MemoryRouter>
    </>
  );
}

export default App;
